    private void processList(int repeats, List<Integer> integers, String s) {
        long startTime;
        long averageTime;
        String msg;
        startTime = System.currentTimeMillis();
        IntStream.range(0, repeats).forEach(i -> {
            if (i == 0) {
                showIntList(integers);
            }
        });
        averageTime = (System.currentTimeMillis() - startTime) / repeats;
        msg = "Gemiddelde duur over " + repeats + " keer: " + averageTime + " ms";
        System.out.println(s + " (" + msg + ")\n");
    }

    private void showIntList(List<Integer> list) {
        for (Integer i : list) {
            System.out.print(i);
            System.out.print(" ");
        }
        System.out.println();
    }


    private List<Integer> convertToIntegerList1(List<String> stringList) {
        ArrayList<Integer> intList = new ArrayList<>();
        for (String s : stringList) {
            intList.add(Integer.valueOf(s));
        }
        return intList;
    }

    private List<Integer> convertToIntegerList2(List<String> stringList) {

        ArrayList<Integer> intList = new ArrayList<>();
        stringList.stream().map(Integer::valueOf).forEach(intList::add);
        return intList;
    }

    private List<Integer> convertToIntegerList3(List<String> stringList) {

        return stringList.stream().map(Integer::valueOf).collect(Collectors.toList());
    }

    private List<Integer> convertToIntegerList4(List<String> stringList) {

        ArrayList<Integer> intList = new ArrayList<>();
        stringList.stream().mapToInt(Integer::valueOf).forEach(intList::add);
        return intList;
    }

